import HomePage from './components/HomePage';
import MyNavbar from './components/Navbar';
import { Switch, Route } from 'react-router-dom';

function App() {
    return (
        <>
            <MyNavbar />
            <Switch>
                <Route exact path='/' component={HomePage} /> {/*navigate between pages with exact path*/}
            </Switch>
        </>
    )
}

export default App;
